      <StyledLink href="https://medium.com/basis-cash" target="_blank">
        Medium
      </StyledLink>
      <StyledLink
        href="https://www.dropbox.com/s/ed5vxvaple5e740/REP-Gaea-Cash-06_11_2020.pdf?dl=0"
        target="_blank"
      >
        Audit
      </StyledLink>
    </StyledNav>
  );
};

const StyledNav = styled.nav`
  align-items: center;
  display: flex;
  width: 100%;
  height: 100%;
  white-space: nowrap;
  flex-wrap: wrap;
  justify-content: center;
`;

const StyledLink = styled.a`
  color: ${(props) => props.theme.color.grey[400]};
  padding-left: ${(props) => props.theme.spacing[3]}px;
  padding-right: ${(props) => props.theme.spacing[3]}px;
  text-decoration: none;
  &:hover {
    color: ${(props) => props.theme.color.grey[500]};
  }
`;
const buyBAS =
  'https://uniswap.exchange/swap?inputCurrency=0x6b175474e89094c44da98b954eedeac495271d0f&outputCurrency=0xa7ed29b253d8b4e3109ce07c80fc570f81b63696';
const buyBAC =
  'https://uniswap.exchange/swap?inputCurrency=0x3449fc1cd036255ba1eb19d65ff4ba2b8903a69a&outputCurrency=0x6b175474e89094c44da98b954eedeac495271d0f';
export default Nav;
